import './App.css';
import Navbar from './components/layout/navbar.js';
import Home from './components/pages/home';
import Footer from './components/layout/footer.js'

function App() {
  return (
    <>
      <header>
        <Navbar />
      </header>
      <section>
        <Home />
      </section>
      <Footer />

    </>
  );
}

export default App;
